import bootstrap from "bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar,Container,Nav} from "react-bootstrap";
import { NavLink } from "react-router-dom";
import "../common/header.css";
import image from "../pictures/pofile.png"
import"../pages/logincss/form.css";
import codestation from "../pictures/logo.png";

export function Header() {
  return (
    <>
   
      <Navbar collapseOnSelect expand="lg" bg="white py-3 shadow-sm" variant="white">
        <Container className="Nav">
        <div className="image">
    <Navbar.Brand href="#home" >
      <img
        src={codestation}
        width="60"
        height="60"
     />   
    </Navbar.Brand>
    </div>
          <Navbar.Brand to="/home" >CODE STATIONS</Navbar.Brand>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
                <Nav className="me-auto">
                <NavLink className="nav-link " to="/home">Home</NavLink>
                <NavLink className="nav-link " to="/about">About</NavLink>
                <NavLink className="nav-link " to="/contact-us">Contact</NavLink>
                </Nav>
            <Nav>
                <div class="profile">
                <img src={image} alt="Avatar" class="avatar"/>
                </div>
                <NavLink className="nav-link" to="/login">OUR SERVICE</NavLink>
                
                
             </Nav>
            
             
             
         
          </Navbar.Collapse>
        </Container>
      </Navbar>
  
    </>
  );
}
